#include <iostream>
#include <string>
#include <unordered_map>

using namespace std;

class Solution {
public:
    int lengthOfLongestSubstring(string s) {
        if (s == ""){
            return 0;
        }
        unordered_map<char, int> char_idx;
        int begin_idx = 0;
        int max_length = 0;
        unsigned int i = 0;
        for (; i < s.size(); ++i){
            int letter_idx = s[i];
            if (char_idx.find(letter_idx) == char_idx.end()
                    || char_idx[letter_idx] < begin_idx){
                char_idx[letter_idx] = i;
            }
            else {
                int length = i - begin_idx;
                if (length > max_length){
                    max_length = length;
                }
                begin_idx = char_idx[letter_idx] + 1;
                char_idx[letter_idx] = i;
            }
        }
        int length = i - begin_idx;
        if (length > max_length){
            max_length = length;
        }
        return max_length;
    }

};

